def transform(sequence):
    first_nonzero_index = next((i for i, x in enumerate(sequence) if x != '0'), len(sequence))
    last_nonzero_index = next((i for i, x in enumerate(sequence[::-1]) if x != '0'), len(sequence)) * -1
    return '0'*(first_nonzero_index) + sequence[first_nonzero_index:last_nonzero_index] + '0'*(len(sequence)+last_nonzero_index)
